import React from 'react';
import Header from '../components/shared/Header';

class Blog extends React.Component{
	render(){
		return(
	  	 <div>
		  	<h1>Welcome to Blogs Page</h1>
		  	<Header />

	  	</div>
	  	)
	}
}
export default Blog;
